import React from 'react'

class Header extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
        <div>
            <h1>ForkU</h1>
            <p>Welcome {firebase.auth().currentUser.displayName}! You are now signed-in!</p>
            <a onClick={() => firebase.auth().signOut()}>Sign-out</a>
        </div>)
    }
}

export default Header
